import React from "react";
import "./KeyItem.css";

const KeyItem = (props) => {
    console.log(props.color);
    return (
        <div id="KeyItem">
            <div className="Circle" sx={{background: green}}></div>
            <p>{props.value}</p>
        </div>
    )
}

export default KeyItem;
